Method.Implementation:
set in = ##class(%Library.FileCharacterStream).%New()
set in.Filename = fileName

set out = ##class(%Library.FileCharacterStream).%New()
set out.Filename = outFileName

set sc = $$$OK
set i = 0
while(1)
{
	set i = i + 1
	set len = 900000
	set str = in.ReadLine(.len, .sc, .eol)
	if $$$ISERR(sc) quit
	if (len < 0) quit

	//write i _ ": " _ len _ $$$EOL

	do out.Write($p(str, " ", 1))

	set len = $length(str, " ")
	for j = 2:1:(len-1)
	{
		if (j#k = 0) do out.Write(" " _ $p(str, " ", j))
	}

	do out.Write(" " _ $p(str, " ", len))
	do out.Write($$$EOL)

}
if $$$ISERR(sc) quit sc

quit out.%Save()
